Ontdek de prachtige details van een van de mooiste insecten ter wereld! De vlinder staat bekend om haar schoonheid en vrijheid. Alsof ze de hele wereld over vliegen en pronken met hun felle kleuren.

&nbsp;

<em>Wist je dat de snelste vlinder wel 100 km per uur kan vliegen? Dat is de pijlstaartvlinder!</em>

&nbsp;

Geschikt voor kinderen vanaf 4 jaar.

