Korte omschrijving:
De Dragonfly JC203 is een magnetische puzzel van de libelle. Deze diertjes hebben antennes waarmee ze hun snelheid kunnen meten. Er bestaat een soort die een spanwijdte van wel 19 cm kan hebben.

&nbsp;

<em>Wist je dat de libelle moeilijk zichtbaar is voor haar vijanden door haar kleuren? Deze hebben een camouflage effect op planten.</em>

&nbsp;

Voor kinderen vanaf 4 jaar.

