Korte omschrijving:
De Stag Beetle JC301 is een magnetisch bouwpakket van een hert kever. De kever heeft zijn naam te danken aan zijn grote kaken die lijken op het gewei van een hert. Deze keversoorten leeft in delen van Europa en Azië.

&nbsp;

<i>Wist je dat alleen de mannetjes zulke grote kaken hebben? Deze hebben ze uitsluitend om andere mannetjes te imponeren, want ze kunnen deze niet samentrekken. Vrouwtjes hebben kleinere, scherpere kaken.</i>

&nbsp;

Aanbevolen leeftijd vanaf 4 jaar.

